import React, { Component, Fragment } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import "./styles/Confirmation.scss";

import Axios from "axios";

import { Redirect } from "react-router-dom";

class Paid extends Component {
  constructor() {
    super();
    this.state = {};
  }

  successPayment = () => {
    Axios.get("http://www.mocky.io/v2/5e3d41272d00003f7ed95c09")
      .then(item => this.setState({ productos: item.data }))
      .catch(err => console.error(err));
  };

  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to="/payment" />;
    }
  };

  render() {
    return (
      <div>
        <Header />

        <Fragment>
          <div className="box">
            <div className="phases-box">
              <div className="state-box">
                <p className="state-phase-check">
                  <i class="fas fa-check"></i>
                </p>
                <p className="name-phase">MIS DATOS</p>
              </div>

              <div className="state-box">
                <p className="state-phase-check">
                  <i class="fas fa-check"></i>
                </p>
                <p className="name-phase">PAGO</p>
              </div>
            </div>

            <form>
              {this.state.productos.map(item => (
                <div className="card-box">
                  <img src="" alt="" />
                  <h2>{item.title}</h2>
                  <p>{item.text}</p>
                </div>
              ))}
              >
            </form>
          </div>
        </Fragment>
        <Footer />
      </div>
    );
  }
}

export default Paid;
